{
  "advertisements": [
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 30,
      "text": "1. Es fucht jemand einen fibren Schreibtisch mit aller Zugehoerdt und schoener Fasson, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 40,
      "text": "2. Man begehrt eine Chaise mit 4 Raedern, und 3 Blaetzen und zu einem Pferd samt zugehoerigem Geschirre, der Liebhaber ist im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 35,
      "text": "3. Wer hier ober auf dem Land noch neuen Traeber zu Brandtemmein Oefenweis zu verkaufen hat, kann im Berichtshaus einen Kaeufer dazu vernehmen, wie auch zu einem mittelmaessigen Sponten, so ebenfalls begehrt wird, beyde ohne Entgeld im Berichtshaus ist zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 30,
      "text": "4. Es fucht jemand eine alte, solide und ungefehr einen Saum haltende Feuerspritzen zum tragen ober zum fahren, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 35,
      "text": "5. Es fucht jemand einen moeglichen Kronenleuchter mit 8 Lichtstoeken, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 30,
      "text": "6. Es verlangt jemand eine nicht gar grosse eiserne Gelt-Cassa zu kaufen, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 35,
      "text": "7. Es verlangt jemand einen glatten nuessbaeumern zierlichfuehrigen Kasten, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 30,
      "text": "8. Man verlangt einen noch guten Racheld-Ofen mittelmaessiger Groesse mit oder ohne Fuss, der Liebhaber ist im Berichtshaus zu erfragen; leihet aber keinen Verzug."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 40,
      "text": "1. Ein Losament mitten im Offenburgers Hof, wie der Augenzeichen zeigen wird, auf naechste Faeschnacht, oder Pfingst-Fronfasten zu beziehen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 45,
      "text": "2. Ein fauberes Losament an der Spalen von einem Stuben und Nebenkammer, oder nach Belieben zwei Kammern mit einem heitern Sommerhaus, alles auf einem Boden und nach Belieben Stallung und Heubuehne, auf Pfingst-Fronfasten zu beziehen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 35,
      "text": "3. Ein Losament mit einem schoenen Laden und Laden-Stueblein neben einem grossen Sommershaus, Stuben, Kuechlin, 2 grosse Kammern, einem bequemen Keller, Holzhaus, ein beschlossenes Baeuchhaus, auf der Eisengaess, im Besrichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 40,
      "text": "4. Ein Losament in der Froeschgaess von einer Stuben, 2 Kammern und Platz zum Hof, auf Pfingst-Fronfasten zu beziehen, im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 45,
      "text": "5. Ein Losament fuer 2 Personen in der Weissgaess, bestehend aus einem Stueblein und Mietsofen, Platz zum Hausrath zu stellen, auf eisernen Boeden, wie auch Platz zum Holz, Brunns neben un Haus, a 5 Pfund Juns des Jahres, kann gleich bezogen werden, im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 40,
      "text": "6. Ein schoenes Losament ebenes Fuesses auf einem Boeden von 3 Stuben, einem grossen Saal, Kammern, Kuechlin, Keller, Platz zum Holz, Zutritt zum Baeuchhaus, und, so beliebig, einem Garten in der Nebenhaeuser Vorstadt, im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 25,
      "text": "7. Eine grosse doppelte Frucht-Schuette auf C. E. Gesellschafft zum Hohen Rupf."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 35,
      "text": "8. Bis den 16ten dies wird eine saeubere Huendin begehrt, um etliche junge Hunde zu auserlesen, gegen einer Erkaennlichkeit; zwei sich anzu melden, ist im Berichtshaus ohne Entgeld zu vernehmen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 30,
      "text": "9. Auf kuenftige Weihnachten ist unter der St. Peter-Schul ein geräumiges Magazin zu verleihen, darum sich in dem Schulhaus anzumelden."
    }
  ]
}
